    while len(fibonacciSeries) < n:
        fibonacciSeries.append(fibonacciSeries[-1] + fibonacciSeries[-2])
    sum_result = sum((f ** 2 for f in fibonacciSeries))

    def is_prime(num):
        if num in (2, 3):
            return True
        if num % 2 == 0 or num == 1:
            return False
        sqr = int(math.sqrt(num)) + 1
        for divisor in range(3, sqr, 2):
            if num % divisor == 0:
                return False
        return True

    def prime_factors(num):
        factors = set()
        while num % 2 == 0:
            (factors.add(2),)
            num = num / 2
        while num % 3 == 0:
            factors.add(3)
            num = num / 3
        sqr = int(math.sqrt(num)) + 1
        for i in range(6, sqr + 1, 6):
            while num % (i - 1) == 0:
                factors.add(i - 1)
                num = num / (i - 1)
            while num % (i + 1) == 0:
                factors.add(i + 1)
                num = num / (i + 1)
        if num > 3:
            factors.add(num)
        return factors
    if is_prime(sum_result):
        return prime_factors(fibonacciSeries[-1] + fibonacciSeries[-1])
    else:
        return 'Sum of squares is not a Prime number.'

